import "./Footer.css"
import facebook from "../../Assets/facebook.svg"
function Footer() {
    return(
        <footer>
            <p>Znajd≈∫ nas na facebooku!</p>
            <a href="https://www.facebook.com" rel="noreferrer" target="_blank"><img src={facebook} alt="Facebook"/></a>
        </footer>
    )
}

export default Footer;
